import React from 'react'
import './App.css';
import transcribe from "./Transcribe";

function App() {


  async function handleTranscribe(event) {
    const selectedFile = event.target.files[0];
    if (selectedFile) {
      transcribe(selectedFile)
    }
  }
         
  return (
    <div className="App">
    <div className="center-container">
    <h1 className="sync-title">Sync</h1>
    <div className="search-bar"> 
    <input type="file" accept=".mp3,.mp4" />
    <div>
      <button onClick={handleTranscribe}>Submit</button>
      </div>     
    </div>
    </div>
    </div>
    );
    }

export default App;
